  .then((ambilData) => {
    console.log(ambilData);
    this.setState({
      judul0: ambilData.data.movies[0],
      judul1: ambilData.data.movies[1],
      judul2: ambilData.data.movies[2],
      judul3: ambilData.data.movies[3],
      judul4: ambilData.data.movies[4]
    }) 
  })
};
render() {
  return (
    <div>
      <center>
        <h1>Coba Get Data</h1>
        <p>{this.state.judul0}</p>
        <p>{this.state.judul1}</p>
        <p>{this.state.judul2}</p>
        <p>{this.state.judul3}</p>
        <p>{this.state.judul4}</p>
      </center>
    </div>
  );
}
}
export default App;
